  false,\n\t\"url\": null,\n\t\"notes\": \"The final objective of the present Fish
  and Wildlife sea otter program is to learn enough of the ecology, population, reproductive
  potential, and requirements in captivity to enable us to carry out a sound management
  program. The study program was initiated after attempts to transplant otters from
  areas of abundance to unoccupied parts of their former range revealed that considerable
  knowledge was needed before such an operation could be successful. This paper is
  a progress report of studies during 1955-1956.\",\n\t\"license_title\": \"License
